import React from "react";
import "./styles/watchlist.css"; // Import CSS file

const Watchlist = () => {
  return (
    <div id="watchlist">
      <div id="watchlist-header">Watchlist</div>
      <div id="watchlist-content">
        <ul>
          <li>Stock 1</li>
          <li>Stock 2</li>
          <li>Stock 3</li>
          {/* Add more stocks as needed */}
        </ul>
      </div>
    </div>
  );
};

export default Watchlist;
